  [],\n\t\"num_tags\": 0,\n\t\"name\": \"global-daily-sea-ice-concentration-reprocessing-data-set-for-1978-2007-from-the-eumetsat-ocean-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"These data constitute the reprocessed sea
  ice concentration data set from the EUMETSAT Ocean and Sea Ice Satellite Application
  Facility (OSI SAF), covering the period from 1978-2007, with data from the Scanning
  Multichannel Microwave Radiometer (SMMR) and the Special Sensor Microwave/Imager
  (SSM/I). The data set provides daily, global coverage at 10 km and 12.5 km spatial
  resolution. Ice concentration is computed from atmospherically corrected brightness
  temperatures, using a combination of state-of-the-art algorithms and dynamic tie-points.
  The data set includes uncertainty estimates for each grid cell (error estimates).
  Version 1 of the data set was released in early 2010.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
